INSERT INTO `glossary` VALUES (1,'International Labour Organisation (ILO)','Chronic diseases are diseases of long duration and generally slow progression. They have many causes but often share common risk factors (e.g. tobacco use, physical inactivity, unhealthy eating and excessive alcohol use). Chronic diseases usually begin slowly and develop gradually over time, can occur at any age, although they are more common in later life, can impact quality of life and limit daily activities, and require ongoing action on a long-term basis to manage the disease, with involvement from individuals, healthcare providers and the community. The four main types of non-communicable diseases are cardiovascular diseases (e.g. heart attacks), cancers, chronic respiratory diseases (e.g. asthma) and diabetes http://www.who.int/topics/noncommunicable_diseases/en/\" class=\"external\" target=\"_blank\"(WHO).'),(2,'Work-related illnesses','Chronic diseases are diseases of long duration and generally slow progression. They have many causes but often share common risk factors (e.g. tobacco use, physical inactivity, unhealthy eating and excessive alcohol use). Chronic diseases usually begin slowly and develop gradually over time, can occur at any age, although they are more common in later life, can impact quality of life and limit daily activities, and require ongoing action on a long-term basis to manage the disease, with involvement from individuals, healthcare providers and the community. The four main types of non-communicable diseases are cardiovascular diseases (e.g. heart attacks), cancers, chronic respiratory diseases (e.g. asthma) and diabetes http://www.who.int/topics/noncommunicable_diseases/en/\" class=\"external\" target=\"_blank\"(WHO).'),(3,'Cancer','Chronic diseases are diseases of long duration and generally slow progression. They have many causes but often share common risk factors (e.g. tobacco use, physical inactivity, unhealthy eating and excessive alcohol use). Chroni