INSERT INTO `literals` VALUES (1,'Global estimates','MENU',NULL,'MENU_ITEM'),(2,'EU estimates','MENU',NULL,'MENU_ITEM'),(3,'EU countries comparison','MENU',NULL,'MENU_ITEM'),(4,'Analysis by illness','MENU',NULL,'MENU_ITEM'),(5,'Glossary','MENU',NULL,'MENU_ITEM'),(6,'About the estimates','MENU',NULL,'MENU_ITEM'),(7,'Site map','FOOTER',NULL,'FOOTER_ITEM'),(8,'Privacy notice','FOOTER',NULL,'FOOTER_ITEM'),(9,'Legal notice','FOOTER',NULL,'FOOTER_ITEM'),(10,'Accessibility','FOOTER',NULL,'FOOTER_ITEM'),(11,'Contact us','FOOTER',NULL,'FOOTER_ITEM'),(12,'Global estimate','HOMEPAGE',NULL,'OTHER_LITERAL'),(13,'EU28 estimate','HOMEPAGE',NULL,'OTHER_LITERAL'),(14,'Cost to society of work-related injury and illness','HOMEPAGE','3','SHORT_TITLE'),(15,'Cost to society of work-related injury and illness','HOMEPAGE','3','LONG_TITLE'),(16,'Work-related injuries and illnesses result in the loss of 3.7% of all work-years globally and 3.1% of those in the EU, equivalent to a cost of  approximately 2,247 billion and 498 billion, respectively.<br/>Source: ILO, 2017','HOMEPAGE','3','RELATED_MESSAGE_$'),(17,'Work-related injuries and illnesses result in the loss of 3.7% of all work-years globally and 3.1% of those in the EU, equivalent to a cost of  approximately 2,206 billion and 449 billion, respectively.<br/>Source: ILO, 2017','HOMEPAGE','3','RELATED_MESSAGE_€'),(18,'Mortality: deaths resulting from work-related injury and illness (number of fatalities)','HOMEPAGE','6','SHORT_TITLE'),(19,'Mortality: deaths resulting from work-related injury and illness (number of fatalities)','HOMEPAGE','6','LONG_TITLE'),(20,'Work-related illnesses account for 86% of all deaths related to work globally and 98% in the EU.<br/>Sources: ILO, 2017 and Eurostat, 2014 (fatal injuries in EU).','HOMEPAGE','6','RELATED_MESSAGE'),(21,'DALY (disability-adjusted life years) lost due to work-related injury and illness (millions of years)','HOMEPAGE','9','SHORT_TITLE'),(22,'DALY (disability-adjusted life years) lost due to work-related injury and illness (millions of years)','HOMEPAGE','9','LONG_TITLE'),(23,'In total, 115.5 million DALY are lost globally as a result of work-related injury and illness and 6,8 million in the EU. 67.3 million of these are years of life lost due to fatal injury or illness (3.3 million in the EU) and 48.2 million are lived with disability (3.4 million in the EU).<br/>Source: ILO, 2017','HOMEPAGE','9','RELATED_MESSAGE'),(24,'YLL','HOMEPAGE','9','LITERAL_AXIS'),(25,'YLD','HOMEPAGE','9','LITERAL_AXIS'),(26,'Percentage of all work-related deaths','HOMEPAGE','11','SHORT_TITLE'),(27,'Percentage of all work-related deaths','HOMEPAGE','11','LONG_TITLE'),(28,'What are the main work-related illnesses and injuries resulting in death and in DALY?','HOMEPAGE','12','TITLE'),(29,'* Deaths due to MSDs are included in `Other´ illnesses','HOMEPAGE','12','OTHER_LITERAL'),(30,'Percentage of all work-related DALY','HOMEPAGE','14','SHORT_TITLE'),(31,'Percentage of all work-related DALY','HOMEPAGE','14','LONG_TITLE'),(32,'What are the main work-related illnesses and injuries resulting in death and in DALY?','HOMEPAGE','15','TITLE'),(33,'Cancer is the biggest killer with 106,307 fatal cases per year in EU28, followed by Circulatory illnesses with 49,462 cases. Also, Cancer has the highest DALY (Years of Life Lost or Years Lived with Disability).<br/>Source: ILO, 2017','HOMEPAGE','15','RELATED_MESSAGE'),(34,'See more about work-related illnesses groups','HOMEPAGE',NULL,'BUTTON'),(35,'Compare the situation in the WHO regions','HOMEPAGE',NULL,'BUTTON'),(36,'Compare the situation in EU countries','HOMEPAGE',NULL,'BUTTON'),(37,'WHO regions and EU28 average comparison','WHO_REGIONS',NULL,'SECTION_TITLE'),(38,'In HIGH and AMRO the cost of non-fatal work-related injury and illness is higher than the fatal ones. Consequently, the number of Years of Lived with Disability (YLD) is higher than the Years of Life Lost (YLL).','WHO_REGIONS',NULL,'INTRO'),(39,'See more about the estimates','WHO_REGIONS',NULL,'BUTTON'),(40,'Mortality','WHO_REGIONS','16','CARROUSEL_TITLE'),(41,'Years of life lost','WHO_REGIONS','17','CARROUSEL_TITLE'),(42,'Years of Life Lost vs Years Lived with Disability','WHO_REGIONS','18','CARROUSEL_TITLE'),(43,'Total cost','WHO_REGIONS','21','CARROUSEL_TITLE'),(44,'Select a country to find out the region it belongs to:','WHO_REGIONS',NULL,'OTHER_LITERAL'),(45,'See more about the situation in the European countries','WHO_REGIONS',NULL,'BUTTON'),(46,'See more about work-related illnesses groups in the WHO regions','WHO_REGIONS',NULL,'BUTTON'),(47,'Mortality: deaths per 100,000 workers','WHO_REGIONS','16','SHORT_TITLE'),(48,'Mortality: deaths per 100,000 workers','WHO_REGIONS','16','LONG_TITLE'),(49,'The mortality rate (deaths resulting from work-related injury and illness per 100,000 workers) ranges from 56 cases in AMRO to 109 cases in EURO per 100,000 workers (93 in the EU28). 80%-98% are due to work-related illness.<br/>Sources: ILO, 2017 and Eurostat, 2014 (fatal injuries in EU)','WHO_REGIONS','16','RELATED_MESSAGE'),(50,'Years of Life Lost (YLL) resulting from fatal cases per 100.000 workers','WHO_REGIONS','17','SHORT_TITLE'),(51,'Years of Life Lost (YLL) resulting from fatal cases per 100.000 workers','WHO_REGIONS','17','LONG_TITLE'),(52,'The rate of years of Life Lost (YLL per 100,000 workers) due to work-related injury and illness ranges from 1,266 years in AMRO to 2,775 years in SEARO per 100.000 workers (1,570 in the EU28).<br/>Source: ILO, 2017','WHO_REGIONS','17','RELATED_MESSAGE'),(53,'Total years lost: Comparison of Years of Life Lost (YLL) and Years Lived with Disability (YLD)','WHO_REGIONS','18','SHORT_TITLE'),(54,'Total years lost: Comparison of Years of Life Lost (YLL) and Years Lived with Disability (YLD)','WHO_REGIONS','18','LONG_TITLE'),(55,'In HIGH and AMRO, more years are lived with disability (YLD) than are lost due to early death (YLL). In the EU28, YLD accounts for 50% and YLL for 50%.<br/>Source: ILO, 2017','WHO_REGIONS','18','RELATED_MESSAGE'),(56,'Cost to society in terms of DALY rate (years per 100,000 workers) and in terms of contribution to work-years lost expressed as percentage equivalent of total GDP (%)','WHO_REGIONS','21','SHORT_TITLE'),(57,'Cost to society in terms of DALY rate (years per 100,000 workers) and in terms of contribution to work-years lost expressed as percentage equivalent of total GDP (%)','WHO_REGIONS','21','LONG_TITLE'),(58,'Disability Adjusted Life Years (DALY) is the sum of Years of Life Lost (YLL) due to work-related death and Years Lived with Disability (YLD) due to work-related injury and illness. DALY rate (years per 100.000 workers) varies from 3,190 years in WPRO to 4,397 years in SEARO (3,127 in the EU28).<br/>Source: ILO, 2017 \r\nThe total cost can be expressed as DALY rate or contribution to work-years lost expressed as percentage equivalent of total GDP (%). In this sense, the workyears loss ranges from 3.19% in WPRO to 4.40% in SEARO.','WHO_REGIONS','21','RELATED_MESSAGE'),(59,'EU countries comparison','EU_COMPARISON',NULL,'SECTION_TITLE'),(60,'3.1% of the GDP work-years are lost due to work-related injury and illness. The majority is due to work-related illnesses reaching the 3,0% of the GDP workyears.','EU_COMPARISON',NULL,'INTRO'),(61,'See more about the estimates','EU_COMPARISON',NULL,'BUTTON'),(62,'Years of life lost','EU_COMPARISON','22','CARROUSEL_TITLE'),(63,'Years lived with disability','EU_COMPARISON','23','CARROUSEL_TITLE'),(64,'Total years lost','EU_COMPARISON','24','CARROUSEL_TITLE'),(65,'Total GDP workyears lost','EU_COMPARISON','25','CARROUSEL_TITLE'),(66,'From work-related injuries','EU_COMPARISON','26','CARROUSEL_TITLE'),(67,'From work-related illnesses','EU_COMPARISON','27','CARROUSEL_TITLE'),(68,'See more about work-related illnesses groups in the EU countries','EU_COMPARISON',NULL,'BUTTON'),(69,'See more about the situation at world level, in the WHO regions','EU_COMPARISON',NULL,'BUTTON'),(70,'Years of Life Lost (YLL) per 100,000 workers','EU_COMPARISON','22','SHORT_TITLE'),(71,'Years of Life Lost (YLL) per 100,000 workers','EU_COMPARISON','22','LONG_TITLE'),(72,'The rate of years of Life Lost (YLL per 100,000 workers) due to work-related injury and illness ranges from 1,256 years in United Kingdom to 2,617 years in Bulgaria per 100.000 workers (1,570 in the EU28).<br/>Source: ILO, 2017','EU_COMPARISON','22','RELATED_MESSAGE'),(73,'Years lived with disability (YLD) per 100,000 workers','EU_COMPARISON','23','SHORT_TITLE'),(74,'Years lived with disability (YLD) per 100,000 workers','EU_COMPARISON','23','LONG_TITLE'),(75,'The rate of years of Lived with Disability (YLD per 100,000 workers) due to work-related injury and illness ranges from 795 years in Estonia to 4,004 years in Iceland per 100.000 workers (1,557 in the EU28).<br/>Source: ILO, 2017','EU_COMPARISON','23','RELATED_MESSAGE'),(76,'Total years lost: Disability adjusted life years (DALY) per 100,000 workers','EU_COMPARISON','24','SHORT_TITLE'),(77,'Total years lost: Disability adjusted life years (DALY) per 100,000 workers','EU_COMPARISON','24','LONG_TITLE'),(78,'Disability Adjusted Life Years (DALY) is the sum of Years of Life Lost (YLL) due to work-related death and Years Lived with Disability (YLD) due to work-related injury and illness. DALY rate (years per 100.000 workers) varies from 2,201 years in United Kingdom to 5,409 years in Iceland (3,127 in the EU28).<br/>Source: ILO, 2017','EU_COMPARISON','24','RELATED_MESSAGE'),(79,'Cost expressed as proportion of all work-years lost expressed as percentage equivalent of total GDP (%)','EU_COMPARISON','25','SHORT_TITLE'),(80,'Cost expressed as proportion of all work-years lost expressed as percentage equivalent of total GDP (%)','EU_COMPARISON','25','LONG_TITLE'),(81,'The total cost can be expressed as DALY rate or as contribution to work-years lost expressed as percentage equivalent of total GDP (%). In this sense, the workyears loss ranges from 2.21% in United Kingdom to 5.41% in Iceland (3.13% in the EU28).<br/>Source: ILO, 2017','EU_COMPARISON','25','RELATED_MESSAGE'),(82,'Work-related injury contribution to total GDP work-years lost','EU_COMPARISON','26','SHORT_TITLE'),(83,'Work-related injury contribution to total GDP work-years lost','EU_COMPARISON','26','LONG_TITLE'),(84,'Work-related injuries contribution to the work-years lost ranges from 0.04% in Netherlands to 0.49% in Luxembourg (0.16% in the EU28).<br/>Source: ILO, 2017','EU_COMPARISON','26','RELATED_MESSAGE'),(85,'Work-related illness contribution to total GDP work-years lost (%)','EU_COMPARISON','27','SHORT_TITLE'),(86,'Work-related illness contribution to total GDP work-years lost (%)','EU_COMPARISON','27','LONG_TITLE'),(87,'Work-related illnesses contribution to workyears lost ranges from 2.15% in United Kingdom to 5.01% in Iceland (2.97% in the EU28).<br/>Source: ILO, 2017','EU_COMPARISON','27','RELATED_MESSAGE'),(88,'Analysis by causes in the EU','EU_ILLNESSES',NULL,'SECTION_TITLE'),(89,'Find out more the comparison of the DALY by illness group','EU_ILLNESSES',NULL,'BUTTON'),(90,'See more about the estimates','EU_ILLNESSES',NULL,'BUTTON'),(91,'Main work-related illnesses and DALY (Years of life lost and lived with disability) per 100.000 workers','EU_ILLNESSES',NULL,'SECTION_SUBTITLE'),(92,'In the majority of the EU28 and Iceland and Norway, the main part of the cost is due to cancer, followed by musculoskeletal disorders (MSD). More information about the impact of each illness group by country will be analyzed in this section.<br/>Source: ILO, 2017','EU_ILLNESSES','31','RELATED_MESSAGE'),(93,'DALY','EU_ILLNESSES','31','SHORT_TITLE'),(94,'DALY','EU_ILLNESSES','31','LONG_TITLE'),(95,'Comparison of the DALY per illness group in the EU','EU_ILLNESSES_RANKING',NULL,'SUBSECTION_TITLE'),(96,'All work-related illnesses and injuries','EU_ILLNESSES_RANKING','32','CARROUSEL_TITLE'),(97,'Cancer','EU_ILLNESSES_RANKING','33','CARROUSEL_TITLE'),(98,'MSD','EU_ILLNESSES_RANKING','34','CARROUSEL_TITLE'),(99,'Circulatory','EU_ILLNESSES_RANKING','35','CARROUSEL_TITLE'),(100,'Years of life lost and lived with disability (DALY) resulting from the main work-related illnesses groups','EU_ILLNESSES_RANKING','32','SHORT_TITLE'),(101,'Years of life lost and lived with disability (DALY) resulting from the main work-related illnesses groups','EU_ILLNESSES_RANKING','32','LONG_TITLE'),(102,'Disability Adjusted Life Years (DALY) is the sum of Years of Life Lost (YLL) due to work-related death and Years Lived with Disability (YLD) due to work-related injury and illness. DALY rate (years per 100.000 workers) varies from 2,201 years in United Kingdom to 5,409 years in Iceland (3,109 in the EU28).<br/>Source: ILO, 2017','EU_ILLNESSES_RANKING','32','RELATED_MESSAGE'),(103,'Years of life lost and lived with disability (DALY) resulting from the main work-related illnesses groups','EU_ILLNESSES_RANKING','33','SHORT_TITLE'),(104,'Years of life lost and lived with disability (DALY) resulting from the main work-related illnesses groups','EU_ILLNESSES_RANKING','33','LONG_TITLE'),(105,'Disability Adjusted Life Years (DALY) is the sum of Years of Life Lost (YLL) due to work-related death and Years Lived with Disability (YLD) due to work-related injury and illness. DALY rate (years per 100.000 workers) resulting from Cancer varies from 642 years in United Kingdom to 1,219 years in Romania (815 in the EU28).<br/>Source: ILO, 2017','EU_ILLNESSES_RANKING','33','RELATED_MESSAGE'),(106,'Years of life lost and lived with disability (DALY) resulting from the main work-related illnesses groups','EU_ILLNESSES_RANKING','34','SHORT_TITLE'),(107,'Years of life lost and lived with disability (DALY) resulting from the main work-related illnesses groups','EU_ILLNESSES_RANKING','34','LONG_TITLE'),(108,'Disability Adjusted Life Years (DALY) is the sum of Years of Life Lost (YLL) due to work-related death and Years Lived with Disability (YLD) due to work-related injury and illness. DALY rate (years per 100.000 workers) resulting from MSD varies from 369 years in Malta to 841 years in Portugal (478 in the EU28).<br/>Source: ILO, 2017','EU_ILLNESSES_RANKING','34','RELATED_MESSAGE'),(109,'Years of life lost and lived with disability (DALY) resulting from the main work-related illnesses groups','EU_ILLNESSES_RANKING','35','SHORT_TITLE'),(110,'Years of life lost and lived with disability (DALY) resulting from the main work-related illnesses groups','EU_ILLNESSES_RANKING','35','LONG_TITLE'),(111,'Disability Adjusted Life Years (DALY) is the sum of Years of Life Lost (YLL) due to work-related death and Years Lived with Disability (YLD) due to work-related injury and illness. DALY rate (years per 100.000 workers) resulting from Circulatory diseases varies from 325 years in Sweden to 689 years in Cyprus (400 in the EU28).<br/>Source: ILO, 2017','EU_ILLNESSES_RANKING','35','RELATED_MESSAGE'),(112,'In this section some of the terms used in the descriptions presented in the tool are described.','GLOSSARY',NULL,'INTRO'),(113,'Billion $','HOMEPAGE','1','LITERAL_AXIS'),(114,'Billion €','HOMEPAGE','1','LITERAL_AXIS'),(115,'Billion $','HOMEPAGE','2','LITERAL_AXIS'),(116,'Billion €','HOMEPAGE','2','LITERAL_AXIS'),(117,'Fatal cases','WHO_REGIONS','16','LITERAL_AXIS'),(118,'YLL','WHO_REGIONS','17','LITERAL_AXIS'),(119,'YLL per 100,000 workers','EU_COMPARISON','22','LITERAL_AXIS'),(120,'YLD per 100,000 workers','EU_COMPARISON','23','LITERAL_AXIS'),(121,'DALY per 100,000 workers','EU_COMPARISON','24','LITERAL_AXIS'),(122,'GDP lost (%)','EU_COMPARISON','25','LITERAL_AXIS'),(123,'GDP lost (%)','EU_COMPARISON','26','LITERAL_AXIS'),(124,'GDP lost (%)','EU_COMPARISON','27','LITERAL_AXIS'),(125,'DALY per 100,000 workers','EU_ILLNESSES_RANKING','32','LITERAL_AXIS'),(126,'DALY per 100,000 workers','EU_ILLNESSES_RANKING','33','LITERAL_AXIS'),(127,'DALY per 100,000 workers','EU_ILLNESSES_RANKING','34','LITERAL_AXIS'),(128,'DALY per 100,000 workers','EU_ILLNESSES_RANKIN